'use strict';

module.exports = {
  root: true,
  // Start with google standard style and disable the prettier-controlled rules
  //     https://github.com/google/eslint-config-google/blob/master/index.js
  extends: ['eslint:recommended', 'plugin:import/errors', 'plugin:import/warnings', 'google', 'prettier', 'plugin:storybook/recommended'],
  // Use the prettier plugin to enforce prettier violations
  plugins: ['prettier', 'import'],
  ignorePatterns: ['dist/'],
  env: {
    node: true,
    es6: true,
  },
  rules: {
    'import/no-extraneous-dependencies': 'error',
    'prettier/prettier': 'error',
    eqeqeq: 'error',
    'no-floating-decimal': 'error',
    'no-empty': [
      'error',
      {
        allowEmptyCatch: true,
      },
    ],
    'no-implicit-coercion': [
      'error',
      {
        boolean: false,
        number: true,
        string: true,
      },
    ],
    'no-unused-expressions': [
      'error',
      {
        allowShortCircuit: true,
        allowTernary: false,
      },
    ],
    'no-unused-vars': [
      'error',
      {
        vars: 'all',
        args: 'after-used',
        argsIgnorePattern: '(^reject$|^_$)',
        varsIgnorePattern: '(^_$)',
      },
    ],
    strict: ['error', 'global'],
    'prefer-const': 'error',
    curly: ['error', 'multi-line'],

    // Disabled rules
    'require-jsdoc': 0,
    'valid-jsdoc': 0,
    'arrow-parens': 0,
  },
  parser: '@typescript-eslint/parser',
  parserOptions: {
    ecmaVersion: 2020,
    ecmaFeatures: {
      globalReturn: true,
      jsx: false,
    },
    sourceType: 'script',
  },
};

/**
 * @license Copyright 2020 Google Inc. All Rights Reserved.
 * Licensed under the Apache License, Version 2.0 (the "License"); you may not use this file except in compliance with the License. You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0
 * Unless required by applicable law or agreed to in writing, software distributed under the License is distributed on an "AS IS" BASIS, WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied. See the License for the specific language governing permissions and limitations under the License.
 */
'use strict';

module.exports = {
  extends: ['./.eslintrc.js'],
  plugins: ['jest'],
  env: {
    'jest/globals': true,
  },
  rules: {
    'import/no-extraneous-dependencies': 'off',
  },
};

/**
 * @license Copyright 2019 Google Inc. All Rights Reserved.
 * Licensed under the Apache License, Version 2.0 (the "License"); you may not use this file except in compliance with the License. You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0
 * Unless required by applicable law or agreed to in writing, software distributed under the License is distributed on an "AS IS" BASIS, WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied. See the License for the specific language governing permissions and limitations under the License.
 */
'use strict';

module.exports = {
  extends: ['./.eslintrc.js', 'plugin:react/recommended', 'prettier'],
  plugins: ['react'],
  env: {
    browser: true,
  },
  rules: {
    'import/no-extraneous-dependencies': 'off', // false positives with parcel and less problematic in bundle jsx anyway
    'import/no-unresolved': 'off', // doesn't support parcel's resolution algorithm
    'react/prop-types': 'off',
    'no-unused-vars': [
      'error',
      {
        vars: 'all',
        args: 'after-used',
        argsIgnorePattern: '(^reject$|^_$)',
        varsIgnorePattern: '(^_$|^h$)',
      },
    ],
    strict: 'off',
  },
  parserOptions: {
    ecmaVersion: 2020,
    ecmaFeatures: {
      jsx: true,
    },
    sourceType: 'module',
    allowImportExportEverywhere: true,
  },
  settings: {
    react: {
      version: '16.0', // we're not really using react, but this version is pretty close
      pragma: 'h', // Preact's pragma is `h`
    },
  },
};

/**
 * @license Copyright 2019 Google Inc. All Rights Reserved.
 * Licensed under the Apache License, Version 2.0 (the "License"); you may not use this file except in compliance with the License. You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0
 * Unless required by applicable law or agreed to in writing, software distributed under the License is distributed on an "AS IS" BASIS, WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied. See the License for the specific language governing permissions and limitations under the License.
 */
'use strict';

module.exports = {
  ci: {
    assert: {
      preset: 'lighthouse:recommended',
      assertions: {
        'dom-size': ['error', {maxNumericValue: 3000}],

        'csp-xss': 'off',
        'unsized-images': 'off',
        'uses-rel-preload': 'off',
        'uses-responsive-images': 'off',
        'uses-rel-preconnect': 'off',
        'preload-lcp-image': 'off',
        'offscreen-images': 'off',
        'unused-javascript': 'off',

        label: 'off',
        'color-contrast': 'off',
        bypass: 'off',
        'tap-targets': 'off',

        'apple-touch-icon': 'off',
        'maskable-icon': 'off',
        'installable-manifest': 'off',
        'service-worker': 'off',
        'splash-screen': 'off',
        'themed-omnibox': 'off',
      },
    },
    upload: {
      urlReplacementPatterns: [
        's/[0-9a-f]{12}$/HASH/',
        's#:[0-9]{3,5}/#:PORT/#',
        's/[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}/UUID/ig',
      ],
    },
  },
};

/**
